function withItemsDo(callback) {
    module('users.fbo.Feeds').load();
    if (!this.getFeedUrl()) { 
        alert('AtomSource: Feed URL not set');
        return; 
    };
    var feed = new users.fbo.Feeds.AtomFeed(this.getFeedUrl()),
        items = feed.items();
    items = items.slice(0, this.getNumberOfItems());
    callback(items);
    if (this.customCallback) {
        items.forEach(function (each) {
            this.customCallback(each);
        }.bind(this)); 
    }
}

